description:
Big I Am, The (2009)  

Verenigd Koninkrijk
Misdaad / Drama
105 minuten

geregisseerd door Nic Auerbach
met Leo Gregory, Vincent Regan en Michael Madsen

Gelegenheidsoplichter Mickey Skinner (Leo Gregory) komt door een toevallige samenloop van omstandigheden plotseling aan het hoofd te staan van een beruchte Londense bende die zich vooral bezig houdt met mensensmokkel. Op laatst genoemde terrein staat de bende op het punt een lucratieve deal te sluiten. Aan Mickey de taak zich door de nieuwe uitdagingen heen te slaan.


